CREATE DEFINER=`root`@`localhost` PROCEDURE `cliente_dame`(IN cDni BIGINT, IN cNombre VARCHAR(45), IN cApellido VARCHAR(45), IN cMail VARCHAR(45), IN cTelefono VARCHAR(45), OUT codigoOut INT)
PROC: BEGIN

    DECLARE cIdCliente BIGINT;
	
    IF EXISTS (SELECT idCliente FROM Clientes WHERE dni=cDni) THEN
		SET cIdCliente = (SELECT idCliente FROM Clientes WHERE dni=cDni);
	ELSE
		BEGIN
			SET cIdCliente = 1 + (SELECT COALESCE(MAX(idCliente),0) FROM Clientes);
			INSERT INTO Clientes VALUES (cIdCliente,cDni,cNombre,cApellido,cMail,cTelefono,NOW(),'A');
        END;
	END IF;
	
    IF (cIdCliente > 0)	THEN 
		SELECT cIdCliente INTO codigoOut;
		LEAVE PROC;
	ELSE
		SELECT 0 INTO codigoOut;
		LEAVE PROC;
    END IF;
    
END ;;
DELIMITER ;
