CREATE DEFINER=`root`@`localhost` PROCEDURE `liquidacion_nueva`(lIdUsuario INT, lIdProfesional INT, montoTotal DECIMAL(20,10), lCadena VARCHAR(1000))
PROC: BEGIN
	/*
    Procedimiento que permite dar de alta una venta a partir de sus Lineas de Venta, contenidas en pLineas.
    Formato de pLineas: idItem|cantidad|precio*
    El operador '|' se utiliza para separar los atributos de un Item.
    El operador '*' se utiliza para separar las Lineas de Venta.
    Devuelve el 'OK' mas el id de la nueva venta en Mensaje.
    */
    -- Declaración de variabless
    DECLARE oIdHistorial INT;
    DECLARE lIdLiquidacion INT;
    DECLARE llIdLineaLiquidacion INT;
    DECLARE aux VARCHAR(50);
    DECLARE oIdOperacion INT;
	DECLARE lTotal DECIMAL (10,2);
    -- Manejo de errores
   DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN
		GET DIAGNOSTICS CONDITION 1
		@c1 = RETURNED_SQLSTATE, @c2 = MESSAGE_TEXT;
		SELECT 
    0 AS codigo,
    CONCAT('Error numero: ',
            @c1,
            '. Descripcion: ',
            @c2) AS mensaje;
		ROLLBACK;
	END;
    
	-- Control de parámetros vacíos
    -- Control de parametros vacios
    IF (lIdUsuario IS NULL OR lIdUsuario = 0) THEN
		SELECT 0 as codigo,'Falta identificador de Usuario' mensaje;
        LEAVE PROC;
	END IF;
    
    IF (lIdProfesional IS NULL OR lIdProfesional = 0) THEN
		SELECT 0 as codigo,'Falta identificador de profesional' mensaje;
        LEAVE PROC;
	END IF;
    
    IF (lCadena IS NULL OR lCadena = '') THEN
		SELECT 0 as codigo,'Faltan operaciones a pagar' mensaje;
        LEAVE PROC;
	END IF;   
   -- Control de parametros no existentes
    IF NOT EXISTS (SELECT idUsuario FROM Usuarios WHERE idUsuario = lIdUsuario) THEN
		SELECT 0 as codigo, 'El Usuario no existe' mensaje;
        LEAVE PROC;
	END IF;
    IF NOT EXISTS (SELECT idProfesional FROM ProfesionalesTemp WHERE idProfesional = lIdProfesional) THEN
		SELECT 0 as codigo, 'El profesional no existe' mensaje;
        LEAVE PROC;
	END IF;
    
    START TRANSACTION;
		SET lTotal = 0;
		SET lIdLiquidacion = 1 + (SELECT COALESCE(MAX(idLiquidacion),1000000) FROM Liquidaciones);
		INSERT INTO Liquidaciones VALUES (lIdLiquidacion,lIdProfesional,NOW(),lTotal,'A');
        LAZO : LOOP
            -- Obtengo idOperacion de lCadena
            SET oIdOperacion = SUBSTRING_INDEX(lCadena,'*',1);
			
            -- Control de parámetros incorrectos
            IF NOT EXISTS (SELECT idOperacion FROM Operaciones WHERE idOperacion = oIdOperacion)	THEN
				SELECT 0 as codigo, 'Error. Operacion inexistente.' mensaje;
                ROLLBACK;
                LEAVE PROC;
			END IF;

            -- Alta en LineasLiquidacion
            SET llIdLineaLiquidacion = 1 + (SELECT COALESCE(MAX(idLineaLiquidacion),0) FROM LineasLiquidaciones);
            INSERT INTO LineasLiquidaciones VALUES (llIdLineaLiquidacion,lIdLiquidacion,oIdOperacion,'A');
            UPDATE Operaciones SET estadoPago = 'PAGADA' WHERE idOperacion = oIdOperacion;
            SET lTotal = (SELECT importeCobrar FROM Operaciones WHERE idOperacion = oIdOperacion) + ltotal;
			
            -- Elimino el idOperacion ya ingresado
			SET oIdOperacion = SUBSTRING_INDEX(lCadena,'*',1);    
			SET lCadena = RIGHT(lCadena,CHAR_LENGTH(lCadena) - CHAR_LENGTH(oIdOperacion));
			SET lCadena = RIGHT(lCadena,CHAR_LENGTH(lCadena)-1);
            
            -- Condición de salida
			IF (lCadena = '') THEN
				LEAVE LAZO;
			END IF;
		END LOOP LAZO;
        
        /* controlamos el total */
        -- redondeamos al segundo digito decimal los 2 importes por las dudas SIEMPRE
        SET lTotal = ROUND((lTotal),2);
        SET montoTotal = ROUND((lTotal),2); -- montoTotal viene desde la vista ionic
        -- ahora controlamos que sean los mismos importes
        IF (lTotal NOT BETWEEN montoTotal - 0.5 AND montoTotal + 0.5) THEN
			SELECT 0 as codigo, 'Importe total incorrecto' mensaje;
			ROLLBACK;
			LEAVE PROC;
		END IF;
        
        UPDATE Liquidaciones SET total = lTotal;
        
        SET oIdHistorial = 1 + (SELECT COALESCE(MAX(idHistorial),0) FROM Historial);
		INSERT INTO Historial VALUES (oIdHistorial,lIdUsuario,'Liquidaciones','nueva',lIdLiquidacion,NOW());
    
	SELECT lIdLiquidacion AS codigo, 'Liquidacion creada con exito.' mensaje;
    COMMIT;
END ;;
DELIMITER ;
