CREATE DEFINER=`root`@`localhost` PROCEDURE `liquidacion_profesional_periodo`(dniProfesional BIGINT, fechaInicio DATE, fechaFin DATE)
PROC: BEGIN

DECLARE lIdProfesional INT;
DECLARE lIdLiquidacion INT;

DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN
		GET DIAGNOSTICS CONDITION 1
		@c1 = RETURNED_SQLSTATE, @c2 = MESSAGE_TEXT;
		SELECT 0 AS codigo, CONCAT('Error numero: ',@c1,'. Descripcion: ',@c2) AS mensaje;
		ROLLBACK;
	END;

	IF NOT EXISTS (SELECT idProfesional FROM ProfesionalesTemp WHERE dni = dniProfesional) THEN 
		SELECT 0 AS codigo, 'Profesional inexistente' as mensaje;
        LEAVE PROC;
	END IF;
    
	SET lIdProfesional = (SELECT idProfesional FROM ProfesionalesTemp WHERE dni = dniProfesional);
	SET lIdLiquidacion =  (SELECT 1 + COALESCE(MAX(idLiquidacion),1000000) FROM Liquidaciones);
    SELECT 1 AS codigo;
	SELECT lIdLiquidacion AS idLiquidacion, NOW() AS fechaEmision;
    SELECT * FROM ProfesionalesTemp WHERE idProfesional = lIdProfesional;
    SELECT 
		o.idOperacion,o.fechaTransaccion,o.fechaPago,o.tipoOperacion,o.nombreTarjeta,o.importeVenta,o.importeCobrar, o.estadoPago,
		c.dni dniCliente, c.apellido apellidoCliente
    FROM	Operaciones AS o
    LEFT JOIN Clientes AS c ON c.idCliente = o.idCliente
    WHERE 
		o.idProfesional = lIdProfesional AND 
        DATE(o.fechaPago) BETWEEN fechaInicio AND fechaFin AND
        o.estadoPago = 'A PAGAR' AND
        o.estado = 'A' 
    ORDER BY o.idOperacion ASC;
END ;;
DELIMITER ;
