CREATE DEFINER=`root`@`localhost` PROCEDURE `migrar_datos`()
BEGIN

	 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
		 BEGIN
			GET DIAGNOSTICS CONDITION 1
			@c1 = RETURNED_SQLSTATE, @c2 = MESSAGE_TEXT;
			SELECT 0 AS codigo, CONCAT('Error numero: ',@c1,'. Descripcion: ',@c2)AS mensaje;
			ROLLBACK;
		 END;

	-- completamos los tipos de operaciones ( MP, o en oficina: web - presencial)
	UPDATE Operaciones
	SET tipoOperacion='MP' 
	WHERE codigoAuto = 0 AND idOperacion >= 50000;

	UPDATE Operaciones
	SET tipoOperacion='WEB' 
	WHERE codigoAuto <> 0 AND idOperacion >= 50000;
    
    UPDATE Operaciones
	SET estadoPago='PAGADA', coinciliada='SI'
	WHERE  DATE(fechaPago) < DATE(NOW()) AND idOperacion >= 50000;
    
    UPDATE Operaciones
	SET estadoPago='A PAGAR' , coinciliada='NO'
	WHERE  DATE(fechaPago) >= DATE(NOW()) AND idOperacion >= 50000;

END ;;
DELIMITER ;
