		IF EXISTS (SELECT idOperacion FROM Operaciones WHERE idOperacion = bandera) THEN
			SET mIdTarjeta = (SELECT idTarjeta FROM Operaciones WHERE idOperacion = bandera);
			SET mTarjetaNombreCorto = (SELECT nombreCorto FROM Tarjetas WHERE idTarjeta = mIdTarjeta);
			-- ahora que se creo el cliente dueño de tarjeta, se ingresa su ID en la tabla OPERACIONES
			UPDATE Operaciones
			SET nombreTarjeta=mTarjetaNombreCorto 
			WHERE idOperacion = bandera;

		END IF;
		SET bandera = bandera + 1;
	END LOOP LAZO2;

END ;;
DELIMITER ;
