CREATE DEFINER=`root`@`localhost` PROCEDURE `operacion_dame`(oIdOperacion INT)
PROC: BEGIN
	/*
    Procedimiento que devuelve productos a partir de una cadena. Para buscar todo, cadena vacia.
    */
    
	IF NOT EXISTS (SELECT oIdOperacion FROM Operaciones WHERE idOperacion = oIdOperacion) THEN
		SELECT 0 as codigo, 'La operacion no existe' mensaje;
        LEAVE PROC;
	END IF;
    
    SELECT 	1 AS codigo, o.idOperacion,o.fechaTransaccion,o.fechaPago,o.tipoTarjeta,o.tipoOperacion,o.productoAdquirido,o.importeVenta,
    o.importeCobrar,o.cuotas,o.importeCuota,o.importeCarga,o.codigoAuto,o.cupon,o.estadoPago,o.nombreTarjeta,
    p.apellido apellidoProfesional,p.nombre nombreProfesional,p.mail mailProfesional,p.dni dniProfesional,
    c.dni dniCliente,c.nombre nombreCliente,c.apellido apellidoCliente,c.mail mailCliente,c.telefono telefonoCliente
    FROM	Operaciones AS o
    LEFT JOIN ProfesionalesTemp AS p ON p.idProfesional=o.idProfesional
    LEFT JOIN Clientes AS c ON c.idCliente=o.idCliente
    WHERE   o.idOperacion=oIdOperacion;
    
END ;;
