CREATE DEFINER=`root`@`localhost` PROCEDURE `operacion_listar_rango`(fechaInicio TIMESTAMP, fechaFin TIMESTAMP)
PROC: BEGIN

	IF NOT (fechaInicio REGEXP '^([1-3][0-9]{3,3})-(0?[1-9]|1[0-2])-(0?[1-9]|[1-2][1-9]|3[0-1])')
		THEN 
		SELECT 0 AS codigo, 'Fecha inicio en formato incorrecto';
		LEAVE PROC;
    END IF;
    IF NOT (fechaFin REGEXP '^([1-3][0-9]{3,3})-(0?[1-9]|1[0-2])-(0?[1-9]|[1-2][1-9]|3[0-1])')
		THEN 
		SELECT 0 AS codigo, 'Fecha fin en formato incorrecto';
		LEAVE PROC;
    END IF;

	IF NOT EXISTS (
			SELECT idOperacion FROM Operaciones WHERE 
			DATE(fechaTransaccion) BETWEEN DATE(fechaInicio) AND DATE(fechaFin)) 
		THEN 
			SELECT 0 AS codigo, 'No se realizaron operaciones en el rango elegido' as mensaje;
        LEAVE PROC;
	END IF;
    
    SELECT 	1 AS codigo, o.idOperacion,o.fechaTransaccion,o.fechaPago,o.tipoTarjeta,o.tipoOperacion,o.productoAdquirido,o.importeVenta,
    o.importeCobrar,o.cuotas,o.importeCuota,o.importeCarga,o.codigoAuto,o.cupon,o.estadoPago,o.nombreTarjeta,
    p.apellido apellidoProfesional,p.nombre nombreProfesional,p.mail mailProfesional,p.dni dniProfesional,
    c.dni dniCliente,c.nombre nombreCliente,c.apellido apellidoCliente,c.mail mailCliente,c.telefono telefonoCliente
    FROM	Operaciones AS o
    LEFT JOIN ProfesionalesTemp AS p ON p.idProfesional=o.idProfesional
    LEFT JOIN Clientes AS c ON c.idCliente=o.idCliente
    WHERE o.estado = 'A' AND DATE(o.fechaTransaccion) BETWEEN DATE(fechaInicio) AND DATE(fechaFin)
    ORDER BY o.idOperacion DESC;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
