CREATE DEFINER=`root`@`localhost` PROCEDURE `operacion_nueva`(oIdProfesional INT, oIdUsuario INT, oNombreTarjeta VARCHAR(45),oDniCliente BIGINT, oApellidoCliente VARCHAR(45), oNombreCliente VARCHAR(45), oTelefonoCliente VARCHAR(45), oMailCliente VARCHAR(45), oTipoTarjeta CHAR(1), oTipoOperacion VARCHAR(25), oProductoAdquirido TEXT, oImporteVenta DECIMAL(20,10), oImporteCobrar DECIMAL(20,10), oCuotas TINYINT, oImporteCuota DECIMAL(20,10), oImporteCarga DECIMAL(20,10), oCodigoAuto BIGINT, oCupon BIGINT)
PROC: BEGIN


	DECLARE oIdOperacion INT;
    DECLARE oIdCliente INT;
    DECLARE oFechaTransaccion TIMESTAMP;
    DECLARE oFechaPago TIMESTAMP;
	DECLARE fechaTransacTemp TIMESTAMP;
    DECLARE oIdHistorial INT;

	 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	 BEGIN
		GET DIAGNOSTICS CONDITION 1
        @c1 = RETURNED_SQLSTATE, @c2 = MESSAGE_TEXT;
		SELECT 0 AS codigo, CONCAT('Error numero: ',@c1,'. Descripcion: ',@c2)AS mensaje;
		ROLLBACK;
	 END;
    
	-- Control de parametros vacios
    IF (oDniCliente IS NULL OR oDniCliente = 0) THEN
		SELECT 0 as codigo,'Debe ingresar el DNI del cliente.' mensaje;
        LEAVE PROC;
	END IF;
    IF (oApellidoCliente IS NULL OR oApellidoCliente = '' ) THEN
		SELECT 0 as codigo,'Debe ingresar el apellido del cliente.' mensaje;
        LEAVE PROC;
	END IF;
    IF (oNombreCliente IS NULL OR oNombreCliente = '' ) THEN
		SELECT 0 as codigo,'Debe ingresar el nombre del cliente' mensaje;
        LEAVE PROC;
	END IF; 
    
    -- Ingresamos/obtenemos ID del cliente nuevo/ya en tabla
    
    CALL cliente_dame(oDniCliente,oNombreCliente,oApellidoCliente,oMailCliente,oTelefonoCliente,@codigoOut);
		IF (@codigoOut = 0) THEN
			SELECT 0 AS codigo, 'Error al crear cliente' AS mensaje;
			LEAVE PROC;
		ELSE
			SET oIdCliente = @codigoOut;
